import VueRouter from "vue-router";
import Vue from "vue";
import Home from "./components/Home";
import Course from "./components/Course";
import Light from "./components/Light";
import Inner from "./components/Inner";
import Degree from "./components/Degree";
import Publisher from "./components/Publisher";
import Oldboyedu from "./components/Oldboyedu";
import Small from "./components/Small";

Vue.use(VueRouter);

export default new VueRouter({
    routes: [
        {
            path: "/",
            name: "home",
            component: Home,
        },
        {
            path: "/course",
            name: "course",
            component: Course,
        },
        {
            path: "/light",
            name: "light",
            component: Light,
        },
        {
            path: "/inner",
            name: "inner",
            component: Inner,
        },{
            path: "/degree",
            name: "degree",
            component: Degree,
        },
        {
            path: "/publisher",
            name: "publisher",
            component: Publisher,
        },{
            path: "/oldboyedu",
            name: "oldboyedu",
            component: Oldboyedu,
        },
        {
            path: "/small",
            name: "small",
            component: Small,
        }


    ]
})
